import React from 'react';
import { Route, Routes } from 'react-router-dom';
import LandingPage from '../pages/Landing';

const AllRoutes = () => {
  return (
    <Routes>
      <Route path='/' element={<LandingPage />} />

      
    </Routes>
  );
};

export default AllRoutes;
